svg.script:
      
	
      function closeinfotip(n)
	{
	document.getElementById('infotip'+n).setAttribute("style", "visibility: hidden"); 
	}

  function showtable(n){
		var i;
		for(i=1; i<7; i++){
		if(i == n){
			document.getElementById('rect'+i).setAttribute("style", "visibility: visible");
			}
		else{
			document.getElementById('rect'+i).setAttribute("style", "visibility: hidden"); 
			}
		}
	}
